import React from "react";
import "./App.css";


function AthleteList ({ athletes, setSelectedAthlete }) {

    function handleClick(e) {
        setSelectedAthlete(e.target.id)
    }

    return (
        <div id="player_container">
            {athletes.map((athlete) => <p key={athlete.id} id={athlete.id} onClick={handleClick}>{athlete.name}, {athlete.age}</p>)}
        </div>
    )
}

export default AthleteList
